/*Table structure for table `sys_task` */

DROP TABLE IF EXISTS `sys_task`;

CREATE TABLE `sys_task` (
  `TASK_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务ID',
  `TASK_CODE` varchar(100) DEFAULT '' COMMENT '任务实例ID',
  `TASK_TYPE` int(1) DEFAULT '0' COMMENT '任务类型',
  `TASK_NAME` varchar(100) DEFAULT '' COMMENT '任务名称',
  `JOB_CLASS` varchar(100) DEFAULT '' COMMENT '执行类',
  `EXECYCLE` int(1) DEFAULT '0' COMMENT '定时类型',
  `DAY_OF_MONTH` int(11) DEFAULT '0',
  `DAY_OF_WEEK` int(1) DEFAULT '0',
  `HOUR` int(11) DEFAULT '0',
  `MINUTE` int(11) DEFAULT '0',
  `INTERVAL_HOUR` int(11) DEFAULT '0',
  `INTERVAL_MINUTE` int(11) DEFAULT '0',
  `TASK_INTERVAL_UNIT` int(1) DEFAULT '0',
  `CRON_EXPRESSION` varchar(20) DEFAULT '' COMMENT 'cron表达式',
  `IS_ENABLE` int(1) DEFAULT '0' COMMENT '是否启用',
  `TASK_REMARK` varchar(255) DEFAULT '' COMMENT '任务备注',
  `USER_ID` int(11) DEFAULT '0' COMMENT '创建人',
  `CREATE_TIME` varchar(20) DEFAULT '0' COMMENT '创建时间',
  `PARAM_VALUE` varchar(100) DEFAULT '0' COMMENT '自定义参数值',
  `STATUS` int(11) DEFAULT '0' COMMENT '任务状态',
  `TASK_INTERVAL` int(11) DEFAULT '500' COMMENT '间隔毫秒数',
  `TASK_ThreadNum` int(11) DEFAULT NULL COMMENT '并发线程数',
  PRIMARY KEY (`TASK_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

